const pad = '000000000010000023400056789000ABC00000D0000000000';

const moves = {
  U: function(key) {
    let pos = key - 7;
    return (pad[pos] === '0' ? key : pos);
  },
  R: function(key) {
    let pos = key + 1;
    return (pad[pos] === '0' ? key : pos);
  },
  D: function(key) {
    let pos = key + 7;
    return (pad[pos] === '0' ? key : pos);
  },
  L: function(key) {
    let pos = key - 1;
    return (pad[pos] === '0' ? key : pos);
  }
}

function getKey(data, key) {
  if (data.length > 0) {
    let str = data.shift();
    str.split('').forEach((dir) => {
      key = moves[dir](key);
    });
    return pad[key] + getKey(data, key);
  }
  return '';
}

console.log(getKey(sampleData, 22));
